      <StyledInput
        placeholder="Amount"
        variant="outlined"
        type="number"
        value={total}
        onChange={(e) => setTotal(e.target.value)}
      />
      <p />
      <StyledButton disabled={isDisabled} onClick={() => calculate()}>
